
IF TYPE_ID(N'ProductIdTable') IS NOT NULL
	DROP TYPE [dbo].[ProductIdTable]

CREATE TYPE [dbo].[ProductIdTable] AS TABLE(
	[ProductId] [INT] NOT NULL,
	PRIMARY KEY CLUSTERED 
(
	[ProductId] ASC
)WITH (IGNORE_DUP_KEY = OFF)
)

IF OBJECT_ID('Person', 'U') IS NOT NULL BEGIN
DROP TABLE [dbo].[Person]
END

IF OBJECT_ID('Person', 'U') IS NULL BEGIN
CREATE TABLE [dbo].[Person](
	[IdentityId] [int] IDENTITY(1,1) NOT NULL,
	[GuidId] [uniqueidentifier] NULL,
	[StringId] [varchar](100) NULL,
	[FirstName] [nvarchar](100) NULL,
	[LastName] [nvarchar](100) NULL,
	[FullName]  AS ((isnull([FirstName],'')+' ')+isnull([LastName],'')),
	[Notes] [varchar](100) NULL,
	[Age] [int] NULL,
	[UpdatedOn] [datetime] NULL,
	[CreatedOn] [datetime] NULL,
	[ConcurrencyToken] [rowversion]
)
END


IF OBJECT_ID('Address', 'U') IS NULL BEGIN

CREATE TABLE [dbo].[Address](
	[AddressID] [int] IDENTITY(1,1) NOT NULL,
	[AddressLine1] [nvarchar](60) NOT NULL,
	[AddressLine2] [nvarchar](60) NULL,
	[City] [nvarchar](30) NOT NULL,
	[StateProvince] [nvarchar](50) NOT NULL,
	[CountryRegion] [nvarchar](50) NOT NULL,
	[PostalCode] [nvarchar](15) NOT NULL,
	[rowguid] [uniqueidentifier] NOT NULL,
	[ModifiedDate] [datetime] NOT NULL
)

