INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (64, N'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to  off-road.', N'7b1c4e90-85e2-4792-b47b-e0c424e2ec94', CAST(0x0000938B00000000 AS DateTime))

