INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (337, N'A true multi-sport bike that offers streamlined riding and a revolutionary design. Aerodynamic design lets you ride with the pros, and the gearing will conquer hilly roads.', N'db560f0b-e70b-42a7-a1f5-3b7e42d3679d', CAST(0x0000938B00000000 AS DateTime))

INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (375, N'Cross-train, race, or just socialize on a sleek, aerodynamic bike.  Advanced seat technology provides comfort all day.', N'747b2185-0320-4fe5-8e8f-27b84a40a838', CAST(0x0000938B00000000 AS DateTime))

